import React, { Component } from "react";
import Card from "react-bootstrap/Card";

class IndexInfo extends Component {
  render() {
    return (
      <React.Fragment>
        <Card bg="light" style={{ width: "18rem" }}>
          <Card.Body>
            <Card.Title>Current Level</Card.Title>
            <Card.Text>{this.props.index.currentValue}</Card.Text>
          </Card.Body>
        </Card>
        const {index} = {this.props.index};
        {constituents.map(constituents => (
          <li key={constituents.assetId}>
            Name: {constituents.assetId} | YtD:{constituents.returns.YtD}
          </li>
        ))}
        <Card bg="light" style={{ width: "18rem" }}>
          <Card.Body>
            <Card.Title>1hr Variation</Card.Title>
            <Card.Text>{this.props.index.returns.h1}</Card.Text>
          </Card.Body>
        </Card>
      </React.Fragment>
    );
  }
}

export default IndexInfo;
